import yfinance as yf
import pandas as pd
import sqlite3
import logging
from datetime import datetime, timedelta

def update_stock_data(stock_data, db_name='db.sqlite3', table_name='base_stocks_data'):
    # Configure logging
    logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(levelname)s - %(message)s')
    
    logging.info(f"Starting update_stock_data function with {len(stock_data)} stocks")

    # Connect to database
    try:
        conn = sqlite3.connect(db_name)
        cursor = conn.cursor()
        logging.info(f"Successfully connected to database: {db_name}")
    except Exception as e:
        logging.error(f"Failed to connect to database: {e}")
        return

    # Ensure the table exists
    cursor.execute(f'''
    CREATE TABLE IF NOT EXISTS {table_name} (
        stock_id INTEGER,
        symbol TEXT,
        Open REAL,
        Close REAL,
        High REAL,
        Low REAL,
        Volume INTEGER,
        date TEXT
    )
    ''')
    conn.commit()

    # Iterate over stock data
    for stock_id, symbol in stock_data.items():
        logging.info(f"Processing stock: {symbol} (ID: {stock_id})")
        try:
            # Query to get the latest date for the current stock
            cursor.execute(f"SELECT MAX(date) FROM {table_name} WHERE stock_id = ?", (stock_id,))
            latest_date_str = cursor.fetchone()[0]
            
            logging.info(f"Latest date in database for {symbol}: {latest_date_str}")

            # Convert latest_date_str to datetime if not None
            latest_date = datetime.strptime(latest_date_str, '%Y-%m-%d') if latest_date_str else None
            
            # Set start_date based on the latest date in the database
            if latest_date:
                start_date = (latest_date + timedelta(days=1)).strftime('%Y-%m-%d')
            else:
                start_date = '2024-06-15'  # Default start date if no data is present
            
            logging.info(f"Fetching data for {symbol} from {start_date}")

            # Fetch data from Yahoo Finance
            data = yf.download(symbol, start=start_date)
            
            logging.info(f"Fetched {len(data)} rows of data for {symbol}")

            # Check for empty dataframe
            if data.empty:
                logging.warning(f"No new data found for {symbol} ({stock_id}) since {start_date}")
                continue

            # Reset index to make 'Date' a regular column
            data = data.reset_index()
            
            # Add stock_id and symbol as columns
            data['stock_id'] = stock_id
            data['symbol'] = symbol
            data['date'] = pd.to_datetime(data['Date']).dt.strftime('%Y-%m-%d')
            
            # Reorder columns and select necessary ones
            data = data[['stock_id', 'symbol', 'Open', 'Close', 'High', 'Low', 'Volume', 'date']]
            
            # Check if data for the same date and stock_id already exists in the database
            cursor.execute(f"SELECT DISTINCT date FROM {table_name} WHERE stock_id=?", (stock_id,))
            existing_dates = set(row[0] for row in cursor.fetchall())
            data = data[~data['date'].isin(existing_dates)]  # Exclude existing dates
            
            if data.empty:
                logging.warning(f"All data for {symbol} ({stock_id}) is already up-to-date")
                continue
            
           
            data.to_sql(table_name, conn, index=False, if_exists='append')
            
            logging.info(f"Imported {len(data)} rows of data for {symbol} ({stock_id})")
        
        except Exception as e:
            logging.error(f"Error importing data for {symbol} ({stock_id}): {e}")
    
    conn.close()
    logging.info("Finished update_stock_data function")


